  "content": "<p data-role=\"original-title\" style=\"display:none\">热巴搭档龚俊演古偶，《帝皇书》中枪，长成这样就别演古装美人了</p>\n            <p class=\"ql-align-justify\">最近热巴的消息可真不少，这边《长歌行》还在热播中，另一边就传出了她又要演古装的消息。这次的古装剧原著小说叫《帝皇书》，讲的是跟男主有血海深仇的女主，帮男主一起开创太平盛世的故事。</p> \n<p class=\"ql-align-center\"><img src=\"https://p0.itc.cn/images01/20210421/70571746447741fc88b2ac542fd89ffd.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-justify\">据说，这部剧的女主选的热巴，男主选的是通过电视剧《山河令》大火的龚俊，这部剧预计今年九月左右就会开机，因为热巴现在还在拍另一部跟任嘉伦搭档的古装剧《与君初相识》。</p> \n<p class=\"ql-align-center\"><img src=\"https://p2.itc.cn/images01/20210421/57ec60f5ed094889bdf15b661be1de60.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-center\"><img src=\"https://p9.itc.cn/images01/20210421/bda40508e38f4783a35e86d2e2417b0d.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-justify\">对于热巴要再演古装，并且是大女主这事儿，很多人其实是不太看好的。因为热巴的古装造型，说实话都不怎么好看。比如现在正在播的《长歌行》，热巴的造型就像得罪了造型师一样，要多磕碜有多磕碜。</p> \n<p class=\"ql-align-center\"><img src=\"https://p0.itc.cn/images01/20210421/4a549a7307dc40c8bb779704215db85b.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-center\"><img src=\"https://p5.itc.cn/images01/20210421/5f5fb5cd1ad34e08a829929a22a72f3a.jpeg\" max-width=\"600\" /></p> \n<p class=\"ql-align-justify\">因为热巴的脸比较长，五官很有异域风情，这样的颜值单拎出来是很美的，可是放在古装剧里，就不怎么样了。前期的时候，造型师还给热巴额头两旁，加了两根长长的须。额前有须的造型很常见，但放在热巴脸上，简直就是在拉垮她的颜值。</p> \n<p class=\"ql-align-center\"><img src=\"https://p7.itc.cn/images01/20210421/e1e8ef53c68c48ad9cdc05403895c165.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-center\"><img src=\"https://p2.itc.cn/images01/20210421/0482712bf74a4440840e6e2c69606fd2.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-justify\">比起热巴不如人意的古装造型，《长歌行》中女二赵露思的造型仿佛就要顺眼得多。有点肉肉的小圆脸，加上这个像兔耳朵一样的盘发，看着就乖乖巧巧的，很舒心。</p> \n<p class=\"ql-align-center\"><img src=\"https://p8.itc.cn/images01/20210421/114e6d970f294f5e88d72d71ea69b3eb.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-center\"><img src=\"https://p8.itc.cn/images01/20210421/da85bb41571f4042b8efa82141c75365.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-justify\">甚至连女N号弥弥古丽，曹曦月的造型都比热巴好看得多。弥弥古丽在剧中就完全是异域女的造型，是让人忍不住想要多看几眼的类型。</p> \n<p class=\"ql-align-center\"><img src=\"https://p3.itc.cn/images01/20210421/2780f8c73f784135981a4efd70f87829.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-center\"><img src=\"https://p2.itc.cn/images01/20210421/0be58bfaec6b4c2586b5ffa0c617be44.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-justify\">其实曹曦月曾经在《楚乔传》里的造型也被吐槽过，因为额头鼻子较大，发型完全揭露了她的短板，尤其是她瞪眼时，最为骇人。在《楚乔传》里，曹曦月给人的印象就是丑，却不曾想，现在换个造型的曹曦月也可以美成这样。</p> \n<p class=\"ql-align-center\"><img src=\"https://p6.itc.cn/images01/20210421/3825899b21d2455aad69bcc4b437c8a3.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-center\"><img src=\"https://p7.itc.cn/images01/20210421/35b40087862447e2900beebfb44428a9.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-justify\">所以，热巴因为长相的缘故，很多古装造型都不太适合她。再比如她在《古剑奇谭》里的造型，这厚重的齐刘海，真的少有几个明星能驾驭。小8当初看《古剑奇谭》时，真没觉得热巴有多美。</p> \n<p class=\"ql-align-center\"><img src=\"https://p1.itc.cn/images01/20210421/f2bbde6d507d4984b122cfc782798348.jpeg\" max-width=\"600\" /></p> \n<p class=\"ql-align-justify\">《秦时明月丽人心》里，虽然没有了须须，也没有了刘海，但是这个一言难尽的盘发，真的是又不好看又显老。</p> \n<p class=\"ql-align-center\"><img src=\"https://p3.itc.cn/images01/20210421/22fd1c6b992f4c3ba3229a93a3c39ede.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-justify\">当然，热巴也有过绝美的时候，那便是她扮演凤九时的造型。当凤九的额前有头发遮挡时，热巴是美艳的。</p> \n<p class=\"ql-align-center\"><img src=\"https://p3.itc.cn/images01/20210421/2bdeed2fb8a24b998fe26a85aeafff17.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-center\"><img src=\"https://p6.itc.cn/images01/20210421/a5fbb1a0cfe54bf58969d3da6bdceb43.jpeg\" max-width=\"600\" /></p> \n<p class=\"ql-align-justify\">可当完全露出额头时，热巴又瞬间失去了光环。</p> \n<p class=\"ql-align-center\"><img src=\"https://p3.itc.cn/images01/20210421/5c24817853524066ae80eb294632add0.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-justify\">最美的时候小8觉得还是她成为妃子的时候，可其他的造型就不怎么样了。</p> \n<p class=\"ql-align-center\"><img src=\"https://p7.itc.cn/images01/20210421/7fc78850b82746f3a9e5422be8e67466.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-justify\">除了造型，热巴的古装抗剧能力也不太行。热巴能火，是因为她在《克拉恋人》里的女二高雯，以及在《十里桃花》里的女二凤九。热巴的女二戏不错，咖位和人气也就慢慢上去了。</p> \n<p class=\"ql-align-center\"><img src=\"https://p4.itc.cn/images01/20210421/946548b12f034c008e33fe61ac15af7b.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-center\"><img src=\"https://p1.itc.cn/images01/20210421/a2cc593fc8cd4dceb112cf466771c3fe.jpeg\" max-width=\"600\" /></p> \n<p class=\"ql-align-justify\">但热巴的女一戏就不怎么样了，这次的《长歌行》，热度虽然还不错，但大部分人都是冲着女二赵露思跟男二刘宇宁的戏份去看的。热巴对这部剧热度的贡献有多少，真的很难说。</p> \n<p class=\"ql-align-center\"><img src=\"https://p6.itc.cn/images01/20210421/2888b7fbb4824a94b74c62259a89495a.jpeg\" max-width=\"600\" /></p> \n<p class=\"ql-align-center\"><img src=\"https://p8.itc.cn/images01/20210421/c06e9a0a03b74e4f98cde40739d982d6.png\" max-width=\"600\" /></p> \n<p class=\"ql-align-justify\">热巴之前演的古装女主，也没有一部是爆了的，就连《枕上书》都没有达到《十里桃花》那样的火爆。细细算来，从《秦时明月丽人心》到《长歌行》，热巴已经扑了4部古装戏了。</p> \n<p class=\"ql-align-center\"><img src=\"https://p5.itc.cn/images01/20210421/89e7dba71caa4ad0a487ba156e95b96c.jpeg\" max-width=\"600\" /></p> \n<p class=\"ql-align-justify\">但现在，热巴还在坚持演古装，不仅跟任嘉伦的古装剧《与君初相识》正在拍摄中，现在还传出了要跟龚俊一起演《帝皇书》的消息。有一说一，热巴的长相既然在古装上并不吃香，那就还是别演古装美人了吧！</p> \n<p class=\"ql-align-center\"><img src=\"https://p5.itc.cn/images01/20210421/fe548495b05b4691b6e82dc94a455b98.jpeg\" max-width=\"600\" />"
} 
